import Vue from 'vue'
import Router from 'vue-router'
Vue.use(Router)

export default new Router({
  routes: [
	  {
		path: '/',
		name: 'bookshelf',
		component: (resolve) => require(['../pages/bookshelf'],resolve)
	  }
    ]
})
